string input = "";

char[] chars = new char[14];

for (int i = 0; i < input.Length; i++)
{
    for (int j = 0; j < chars.Length; j++)
    {
        if (j == chars.Length - 1)
        {
            chars[j] = input[i];
            break;
        }
        chars[j] = chars[j + 1];
    }
    if (chars.Distinct().Count() is 14 && !chars.Contains('/'))
    {
        Console.WriteLine(i + 1);
        break;
    }
}
